					areaStyle: { normal: {} },
					max: function (value) {
						return value.max;
					},
					data: DEN
				}
			]
		};
		var myChart = echarts.init(document.getElementById('main'));

<script type="text/javascript">
    mini.parse();
    var editWindow = mini.get("editWindow");
    var errorWindow = mini.get("errorWindow");
    var grid = mini.get("datagrid");
    var btnYes = document.getElementById("yes");
    var btnNo = document.getElementById("no");
    grid.load();
    //操作
    function onActionRenderer(e) {
        var record = e.record;
        var s = '<a class="Edit_Button" href="javascript:edit()">[修改]</a>' +
            ' <a class="Edit_Button" href="javascript:remove()">[删除]</a>';
        return s;
    }

    //查询数据
    function search() {
        var value = mini.get("#searchs").getValue();
        grid.load({ value: value });
    }
    //返回
    function back() {
        grid.load();
    }

    //添加数据
    function add() {
        clearText();
        mini.get("#btn").setText("确定");
        var form = new mini.Form("#editform");
        form.clear();
        editWindow.show();
    }
    //更新数据
    function edit() {
        clearText();
        mini.get("#btn").setText("更新");
        var row = grid.getSelected();
        if (row) {
            var id = row.id;
            editWindow.show();
            var form = new mini.Form("#editform");
            form.clear();
            form.loading();
            $.ajax({
                url: "/org/department/get/" + id,
                type: "post",
                success: function (text) {
                    form.unmask();
                    var o = mini.decode(text);
                    form.setData(o);
                },
                error: function () {
                    popWin("表单加载错误");
                    cancelWin();
                    form.unmask();
                }
            });

        } else {
            popWin("请选中一条记录");
            cancelWin();
        }
    }
    //提交更新和添加的数据
    function updateRow() {
        var btnText = mini.get("#btn").getText();
        if (btnText == "确定") {
            url = "/org/department/save";
        } else {
            url = "/org/department/update";
        }
        var form = new mini.Form("editform");
        form.validate();
        if (form.isValid() == false) return;
        var data = form.getData();
        grid.loading("保存中，请稍后......");
        $.ajax({
            url: url,
            type: "post",
            data: data,
            success: function (text) {
                grid.reload();
            },
            error: function (jqXHR, textStatus, errorThrown) {
                alert(jqXHR.responseText);
            }
        });
        editWindow.hide();
    }
    //删除数据
    function remove() {
        var rows = grid.getSelecteds();
        if (rows.length > 0) {
            popWin("确定删除选中记录？");
            //点击确认时删除
            btnYes.onclick = function () {
                var ids = [];
                for (var i = 0, l = rows.length; i < l; i++) {
                    var r = rows[i];
                    ids.push(r.id);
                }
                var id = ids.join(',');
                grid.loading("操作中，请稍后......");
                $.ajax({
                    url: "/org/department/delete/" + id,
                    type: "post",
                    success: function (text) {
                        search();
                    },
                    error: function () {
                    }
                });
                errorWindow.hide();
            }
            //点击取消时不删除
            btnNo.onclick = function () {
                errorWindow.hide();
            }
        } else {
            popWin("请选中一条记录");
            cancelWin();
        }
    }
    //关闭更新和添加窗口
    function cancelRow() {
        grid.reload();
        editWindow.hide();
    }
    //弹出窗口
    function popWin(text) {
        var error = document.getElementById("errorWindow_text");
        error.innerHTML = text;
        errorWindow.show();
    }
    //关闭错误提示窗口
    function cancelWin() {
        btnYes.onclick = function () {
            errorWindow.hide();
        }
        btnNo.onclick = function () {
            errorWindow.hide();
        }
    }
    //清除验证提示
    function clearText() {
        var errorTds = document.getElementsByClassName("error");
        for (var i = 0; i < errorTds.length; i++) {
            errorTds[i].innerHTML = "";
        }
    }
</script>
